import React, { useEffect, useCallback } from 'react'
import axios from 'axios'
import gql from 'graphql-tag'
import { print } from 'graphql'

const listPaymentRequest = gql`
    query listPaymentRequest {
        listPaymentRequests {
            items {
                bonusAmount
                createdAt
                customerId
                id
                orderId
                status
                updatedAt
            }
        }
    }
`

const AcceptPayment = () => {
    const fetchPaymentRequests = useCallback(async () => {
        try {
            const data = await axios({
                url:
                    'https://kytejmxrrrgahiikcodklhf6rq.appsync-api.us-east-1.amazonaws.com/graphql',
                method: 'post',
                headers: {
                    'x-api-key': 'da2-iwznaxe3h5bxznagzuctrhqekm'
                },
                data: {
                    query: print(listTransactions)
                }
            })
            console.log('Zaven jan here is the data about payment request', data)
        } catch (error) {
            console.log(error)
        }
    }, [])

    useEffect(() => {
        fetchPaymentRequests()
    }, [fetchPaymentRequests])
    return <div>Hello from Accep payment</div>
}

export default AcceptPayment
